(*Stack Reset*)
Stack.ACT_AutomaticExecute(SFCReset:=TRUE);
Stack.ACT_Init(SFCReset:=TRUE);
Stack.ACT_ProvideWP(SFCReset:=TRUE);
Stack.Seperator.ACT_Extend(SFCREset:=TRUE);
Stack.Seperator.ACT_Retract(SFCREset:=TRUE);

(*Crane Reset*)
Crane.ACT_AutomaticExecute(SFCReset:=TRUE);
Crane.ACT_Init(SFCReset:=TRUE);
Crane.ACT_MoveToConveyor(SFCReset:=TRUE);
Crane.ACT_MoveToStack(SFCReset:=TRUE);
Crane.ACT_MoveToStamp(SFCReset:=TRUE);
Crane.ACT_PickUpWP(SFCReset:=TRUE);
Crane.ACT_PutDownWP(SFCReset:=TRUE);
Crane.LiftingCylinder.ACT_Extend(SFCREset:=TRUE);	
Crane.LiftingCylinder.ACT_Retract(SFCREset:=TRUE);
Crane.Gripper.ACT_Intake(SFCREset:=TRUE);
Crane.Gripper.ACT_Release(SFCREset:=TRUE);	
Crane.LSC_AllowedToOperate := FALSE;
Crane.Stamp_AllowedToOperate := FALSE;

(*LargeSortingConveyor Reset*)
LargeSortingConveyor.ACT_ChangeTarget(SFCReset:=TRUE);
LargeSortingConveyor.ACT_CheckWPType(SFCReset:=TRUE);
LargeSortingConveyor.ACT_Init(SFCReset:=TRUE);
LargeSortingConveyor.ACT_SortWP(SFCReset:=TRUE);
LargeSortingConveyor.Motor.ACT_Stop(SFCREset:=TRUE);
//LargeSortingConveyor.Motor.ACT_TurnBackwards(SFCREset:=TRUE);
//LargeSortingConveyor.Motor.ACT_TurnForwards(SFCREset:=TRUE);
LargeSortingConveyor.Seperator1.ACT_Retract(SFCREset:=TRUE);
LargeSortingConveyor.Seperator2.ACT_Extend(SFCREset:=TRUE);
LargeSortingConveyor.Seperator2.ACT_Retract(SFCREset:=TRUE);

(*Stamp Reset*)
Stamp.ACT_Init(SFCReset:=TRUE);
Stamp.ACT_Stamp(SFCReset:=TRUE);
Stamp.SlidingCylinder.ACT_Extend(SFCREset:=TRUE);
Stamp.SlidingCylinder.ACT_Retract(SFCREset:=TRUE);
Stamp.StampingCylinder.ACT_Extend(SFCREset:=TRUE);
Stamp.StampingCylinder.ACT_Retract(SFCREset:=TRUE);



IF(Stack.Panel.DI_StartButton OR Stamp.Panel.DI_StartButton OR LargeSortingConveyor.Panel.DI_StartButton)THEN
	Stamp.Stamp_SoftwareEmergency:=FALSE;
	Crane.Crane_SoftwareEmergency:=FALSE;
END_IF	

SFCResetCompleted:=TRUE;

LargeSortingConveyor.ACT_WhiteLampOn();
Stack.ACT_WhiteLampOn();	
Stamp.ACT_WhiteLampOn();
LargeSortingConveyor.ACT_GreenLampOff();
Stack.ACT_GreenLampOff();	
Stamp.ACT_GreenLampOff();

LargeSortingConveyor.ACT_WhiteLampOff();
Stack.ACT_WhiteLampOff();	
Stamp.ACT_WhiteLampOff();
LargeSortingConveyor.ACT_GreenLampOn();
Stack.ACT_GreenLampOn();	
Stamp.ACT_GreenLampOn();

Crane.Crane_SoftwareEmergency:=FALSE;
Stamp.Stamp_SoftwareEmergency:=FALSE;

Crane.InitCompleted:=FALSE;
LargeSortingConveyor.InitCompleted:=FALSE;
Stamp.InitCompleted:=FALSE;
Stack.InitCompleted:=FALSE;
InitCompleted:=FALSE;

(*Stack Reset*)
Stack.ACT_AutomaticExecute(SFCReset:=FALSE);
Stack.ACT_Init(SFCReset:=FALSE);
Stack.ACT_ProvideWP(SFCReset:=FALSE);
Stack.Seperator.ACT_Extend(SFCREset:=FALSE);
Stack.Seperator.ACT_Retract(SFCREset:=FALSE);		
(*Crane Reset*)
Crane.ACT_AutomaticExecute(SFCReset:=FALSE);
Crane.ACT_Init(SFCReset:=FALSE);
Crane.ACT_MoveToConveyor(SFCReset:=FALSE);
Crane.ACT_MoveToStack(SFCReset:=FALSE);
Crane.ACT_MoveToStamp(SFCReset:=FALSE);
Crane.ACT_PickUpWP(SFCReset:=FALSE);
Crane.ACT_PutDownWP(SFCReset:=FALSE);
Crane.LiftingCylinder.ACT_Extend(SFCREset:=FALSE);	
Crane.LiftingCylinder.ACT_Retract(SFCREset:=FALSE);
Crane.Gripper.ACT_Intake(SFCREset:=FALSE);
Crane.Gripper.ACT_Release(SFCREset:=FALSE);	
(*LargeSortingConveyor Reset*)
LargeSortingConveyor.ACT_ChangeTarget(SFCReset:=FALSE);
LargeSortingConveyor.ACT_CheckWPType(SFCReset:=FALSE);
LargeSortingConveyor.ACT_Init(SFCReset:=FALSE);
LargeSortingConveyor.ACT_SortWP(SFCReset:=FALSE);
LargeSortingConveyor.Motor.ACT_Stop(SFCREset:=FALSE);
//LargeSortingConveyor.Motor.ACT_TurnBackwards(SFCREset:=FALSE);
//LargeSortingConveyor.Motor.ACT_TurnForwards(SFCREset:=FALSE);
LargeSortingConveyor.Seperator1.ACT_Retract(SFCREset:=FALSE);
LargeSortingConveyor.Seperator2.ACT_Extend(SFCREset:=FALSE);
LargeSortingConveyor.Seperator2.ACT_Retract(SFCREset:=FALSE);
(*Stamp Reset*)
Stamp.ACT_Init(SFCReset:=FALSE);
Stamp.ACT_Stamp(SFCReset:=FALSE);
Stamp.SlidingCylinder.ACT_Extend(SFCREset:=FALSE);
Stamp.SlidingCylinder.ACT_Retract(SFCREset:=FALSE);
Stamp.StampingCylinder.ACT_Extend(SFCREset:=FALSE);
Stamp.StampingCylinder.ACT_Retract(SFCREset:=FALSE);


SFCResetCompleted:=FALSE;	

StartInit:=TRUE;

Emergency:=TRUE;

LargeSortingConveyor.ACT_WhiteLampOff();
Stack.ACT_WhiteLampOff();	
Stamp.ACT_WhiteLampOff();
LargeSortingConveyor.ACT_GreenLampOff();
Stack.ACT_GreenLampOff();	
Stamp.ACT_GreenLampOff();

